import React from 'react';

const Checkhours = () => {
  return (
    <div style={styles.page}>
      <h1>ดูชั่วโมงจิตอาสา</h1>
      <p>แสดงจำนวนชั่วโมงจิตอาสาที่สะสมไว้</p>
    </div>
  );
};

const styles = {
  page: {
    padding: '20px',
    fontFamily: 'Arial',
  },
};

export default Checkhours; // ✅ แค่ 1 export
